import React from "react";
import ReactDOM from "react-dom";
//import Image from "./Mep";


function Img(props){
  return(
  <>
  <div>
  
<img src={props.img} alt="nothing to show"/>
</div>
<div>
<h1>{props.imgno}</h1>
  </div>
  </>
  )
}


ReactDOM.render(
<div>

<Img img="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQPxhiZcMvhaJLG5r2g2a41EHLnIxYWxoq_Lw&usqp=CAU"
     imgno="first image" 



/>
<Img img="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRZYMA-_5zLCAVSi7A4UOZiu5VamTsWCYlMRw&usqp=CAU" 
      imgno="second image"
/>
<Img img='https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSrABG6od_yVCwenX7T1einPeabrncQVLbDmA&usqp=CAU'
      imgno="third image"
/>




</div>,
document.getElementById('root'));
